import { Row, Col } from 'antd';
import './'

function Footer(props) {
  return (
    <>
      <Row style={{ paddingTop: `75px`, paddingBottom: `97px ` }}>
        <Col
          xs={{ span: 8, offset: 0 }}
          sm={{ span: 8, offset: 0 }}
          md={{ span: 10, offset: 0 }}
          lg={{ span: 5, offset: 5 }}
        ></Col>
      </Row>
    </>
  );
}

export default Footer;
